擅长:
1.熟练掌握各种手外科常见疾病的诊治、各种处理方式;
2.突破直径0.3mm的微管道吻合技术，独立熟练完成组织块离断、末节指体离断、脱套及旋转撕脱离断、伴组织缺损等难度较大的断指的再植、足趾移植手指再造；
3.擅长复合性手部及肢体损伤的修复重建、常用的四肢岛状皮瓣、游离皮瓣修复技术，各类组织瓣修复，应用桥接血流皮瓣、骨瓣、急诊手再造等技术挽救濒临截肢肢体;
4.常规开展手腕部骨折的闭合、微创复位固定；掌握腕关节镜诊疗技术；开展四肢先天畸形及瘢痕的矫形及美容治疗技术；熟练应用康复理疗技术、支具技术及各种神经吻合、移位、功能肌肉移植修复重建各类神经损伤导致的功能障碍。
5.对骨关节感染、软组织感染、糖尿病足等感染性创面的清理、修复有丰富的经验。
